	private  CategoryOfShops NavigationPaknSave2CategoryOfShops (NavigationPaknSave navigation) {
		CategoryOfShops categoryOfShops = new CategoryOfShops();
		categoryOfShops.setIsInMobileHeader(navigation.getIsInMobileHeader().toString());
		categoryOfShops.setItemId(navigation.getItemId());
		categoryOfShops.setItemName( navigation.getItemName());
		categoryOfShops.setName(navigation.getName());
		categoryOfShops.setUrl(navigation.getURL());
		categoryOfShops.setParentId(navigation.getParenetID());
		categoryOfShops.setStatus(1);
		categoryOfShops.setShopId(2);
		 
		if (navigation.getChildren().size()>0) {
			for(NavigationPaknSave n:navigation.getChildren())
				categoryOfShops.add(NavigationPaknSave2CategoryOfShops(n));
			//	System.out.println(categoryOfShops.toString());
		}
		return categoryOfShops;
		
	}
	
 
	
	
	private void insert (CategoryOfShops record) {
 		insertSelective(record);
		int id =record.getId();
		for (CategoryOfShops c : record.getChildren()) {
			c.setParentId(id);
			insert(c);
		}
				
	}
	
	
